import '../styles/layout/CharactersList.scss';

const CharactersList = (props) => {
  const html = props.data.map((character, index) => (
    <li className='main__form2--list--item item'>
      <img src='' alt='personaje' />
      <h2
        className='main__form2--list--item--name name'
        alt='nombre'
        title='nombre'
      ></h2>
      <h3
        className='main__form2--list--item--species species'
        alt='especie'
        title='especie'
      ></h3>
    </li>
  ));

  return <ul className='main__form2--list list'>{html}</ul>;
};
export default CharactersList;
